import ResultTable from "./ResultTable";

const Result = (props) => {
    if(!props.valid) {
        return (
            <p>No investment calculated yet.</p>
        );
    } else {
        return (
            <ResultTable input={props.userInput} />
        );
    }
};

export default Result;
